import random
import time

# Função para realizar a troca de dois elementos
def swap(array, i, j):
    array[i], array[j] = array[j], array[i]

# Função para realizar a partição do quicksort
def partition(array, low, high):
    pivot = array[high]
    i = low - 1
    for j in range(low, high):
        if array[j] <= pivot:
            i += 1
            swap(array, i, j)
    swap(array, i + 1, high)
    return i + 1

# Função principal do quicksort
def quick_sort(array, low, high):
    if low < high:
        pi = partition(array, low, high)
        quick_sort(array, low, pi - 1)
        quick_sort(array, pi + 1, high)

# Função principal do programa
def main():
    size = int(input("Informe o tamanho do array: "))

    # Gera números aleatórios para o array
    array = [random.randint(0, 999) for _ in range(size)]
    print("Array antes da ordenação:")
    print(array)

    # Medir o tempo de execução
    start_time = time.time()

    # Chama o quick_sort
    quick_sort(array, 0, len(array) - 1)

    # Tempo de execução
    end_time = time.time()
    execution_time = (end_time - start_time) # tempo

    print("Array ordenado:")
    print(array)

    # Exibe o tempo de execução
    print(f"Tempo de execução: {execution_time:.2f} segundos")

if __name__ == "__main__":
    main()

"""Quick sort (n²) - não recursivo"""

import random
import time

def quick_sort_non_recursive(arr):
    # Inicializa uma pilha para simular a recursão
    stack = [(0, len(arr) - 1)]

    # Loop enquanto houver algo na pilha
    while stack:
        low, high = stack.pop()

        if low < high:
            # Particiona o array e obtém o índice do pivô
            pivot_index = partition(arr, low, high)

            # Empilha as sublistas da esquerda e da direita do pivô
            stack.append((low, pivot_index - 1))  # Sublista esquerda
            stack.append((pivot_index + 1, high))  # Sublista direita

    return arr


def partition(arr, low, high):
    pivot = arr[high]  # Usando o último elemento como pivô
    i = low - 1        # Índice do menor elemento

    for j in range(low, high):
        if arr[j] < pivot:
            i += 1
            arr[i], arr[j] = arr[j], arr[i]  # Troca de lugar os elementos

    # Coloca o pivô na posição correta
    arr[i + 1], arr[high] = arr[high], arr[i + 1]

    return i + 1  # Retorna o índice do pivô


def generate_random_list(N, min_val=0, max_val=1000):
    """
    Gera uma lista de N elementos aleatórios no intervalo [min_val, max_val].
    """
    return [random.randint(min_val, max_val) for _ in range(N)]


# Exemplo de uso com N elementos e medição de tempo
N = 1000  # Pode ser modificado para qualquer quantidade Ex.: 1000000
arr = generate_random_list(N)

print("Ordenando uma lista de", N, "elementos...")

# Início da medição de tempo
start_time = time.time()

sorted_arr = quick_sort_non_recursive(arr)

# Fim da medição de tempo
end_time = time.time()

# Calcula e exibe o tempo de execução
execution_time = end_time - start_time
print("Array ordenado:", sorted_arr)
print(f"Tempo de execução: {execution_time:.6f} segundos")

"""Merge Sort (n log n)"""

import random
import time

def merge_sort_iterative(arr):
    width = 1
    n = len(arr)

    # Itera sobre as sublistas com tamanho (width), que começa em 1 e vai dobrando
    while width < n:
        for i in range(0, n, 2 * width):
            left = i
            mid = min(i + width, n)
            right = min(i + 2 * width, n)

            # Realiza a fusão das sublistas
            merged = merge(arr[left:mid], arr[mid:right])
            arr[left:left + len(merged)] = merged

        # Dobra o tamanho da sublista
        width *= 2

    return arr


def merge(left, right):
    result = []
    i = j = 0

    # Compara e funde duas sublistas
    while i < len(left) and j < len(right):
        if left[i] < right[j]:
            result.append(left[i])
            i += 1
        else:
            result.append(right[j])
            j += 1

    # Adiciona os elementos restantes de ambas as listas
    result.extend(left[i:])
    result.extend(right[j:])

    return result


def generate_random_list(N, min_val=0, max_val=1000):
    """
    Gera uma lista de N elementos aleatórios no intervalo [min_val, max_val].
    """
    return [random.randint(min_val, max_val) for _ in range(N)]


# Exemplo de uso com N elementos e medição de tempo
N = 10000  # Pode ser modificado para qualquer quantidade Ex.: 1000000
arr = generate_random_list(N)

print("Ordenando uma lista de", N, "elementos...")

# Início da medição de tempo
start_time = time.time()

sorted_arr = merge_sort_iterative(arr)

# Fim da medição de tempo
end_time = time.time()

# Calcula e exibe o tempo de execução
execution_time = end_time - start_time
print("Array ordenado:", sorted_arr)
print(f"Tempo de execução: {execution_time:.6f} segundos")

